INSERT INTO `common_questions` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(2, 'ازاي اسجل بالموقع ؟', '<p><p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">هتدخل علي<b> سجل</b> الان هتظهرلك قائمه سجل\r\nفيها<br>\r\n<span style=\"mso-spacerun:yes\">&nbsp;</span>الاسم/ ورقم موبايلك اللى هنتابعك عليه / ايميلك / الباسورد / وتأكيد للباسورد / العنوان بتاعك / </span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">اسم الجروب او البيدج بتاعتك <span style=\"mso-spacerun:yes\">&nbsp;</span>/ لينك الجروب او البيدج بتاعتك</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">بعد كده هتضغط علي حفظ - واحنا هنفعل الاكونت\r\nبتاعك وهنتصل عليك </span></p><br></p>', '2021-03-17 14:23:40', '2021-03-17 14:23:40'),
(3, 'ازاي ادخل علي الموقع بعد مسجلت ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">هتدخل علي تسجيل الدخول من فوق على اليمين</span></p>\r\n\r\n<span lang=\"AR-EG\" dir=\"RTL\" style=\"font-size:11.0pt;line-height:115%;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-EG\">هدخل\r\nالايميل الي سجلت بيه والباسورد هيدخلك علي الصفحه بتاعتك </span><br>', '2021-03-17 14:24:20', '2021-03-17 14:24:20'),
(4, 'ايه الفرق بين انواع الرصيد الموجوده علي الموقع ؟', '<p><span>الرصيد المتاح ( دا الربح بتاعك في المنتجات\r\nالي خلاص اتسلمت وممكن تطلب سحبها </span></p>\r\n\r\n<p><span>الرصيد المعلق ( دا الربح بتاعك للاوردرات\r\nالي لسه العميل هيستلمها )</span></p>\r\n\r\n<p><span>الرصيد الكلي ( دا مجموع الرصيد المتاح بتاعك\r\nوالرصيد المعلق )</span></p>', '2021-03-17 14:27:32', '2021-03-17 14:27:32'),
(5, 'ازاي ادخل علي المنتجات ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">هتدخل علي قائمه متجر فى القايمه على الشمال\r\nهيدخلك علي كل المنتجات <b></b>\r\n    </span>\r\n</p><br>', '2021-03-17 14:28:22', '2021-03-17 14:28:22'),
(6, 'ايه الرقمين الي تحت كل منتج ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">الرقم الاول السعر الي هتبيع بيه للعميل</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">الرقم التاني اللي مكتوب عليه نسبه الربح دا الفلوس\r\nالي هتكسبها علي كل منتج تبيعه </span></p><br>', '2021-03-17 14:28:56', '2021-03-17 14:28:56'),
(7, 'ازاي اسجل اوردر ؟', '<p><br></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">هتلاقي 2 قايمه لما تدخل على اى منتج (تحت\r\nسعر المنتج) </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">اضافه الي اوردر جديد / اضافه الي اوردر\r\nموجود </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">لو العميل عايز اوردر واحد بس هتسجل اضافه\r\nالي اوردر جديد </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">لو العميل طلب اكتر من منتج بعد ماسجلت منتج\r\nجديد بتختار اضافه الى اوردر موجود<br>\r\nوبعدين بتختار اوردر العميل اللى هتضيف عليه منتجات تانيه لنفس العميل </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">هتلاقي تاريخ استلام الطلب ( دا التاريخ <span style=\"mso-spacerun:yes\">&nbsp;</span>الي العميل اكد فيه الاوردر معاك )</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">ميعاد التوصيل المتوقع ( الوقت الي العميل\r\nعايز يستلم فيه )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">اسم العميل ( اسم العميل صاحب الاوردر )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">رقم التليفون (رقم تليفون العميل )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">رقم تليفون تاني ( رقم تاني للعميل (خد دايما\r\nرقمين من العميل وانت بتاكد معاه الاوردر )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">مكان التوصيل ( المكان الي العميل عايز يستلم\r\nفيه قاهره ولا محافظات )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">العنوان( دا عنوان العميل بالظبط تفصيلي )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">العربون ( دا الديبوزت الي هتاخده من العميل\r\n)</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">حساب الاوردر الاجمالي ( تكلفه الاوردر كام\r\nلوحده من غير الشحن )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">الصوره الرئيسيه ( لو العميل طالب اوردر\r\nوهيضيف فيه صوره او اكتر من صوره </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">وهتلاقي جمبها ملحوظه دي الحاجه او البيانات\r\nالي عايز تكتبها علي الصوره )</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\">الوصف ( شرح الاوردر العميل عايزاه ازاي سواء\r\nهيضيف صوره واسم او جمله او اي ملحوظه تانيه عايزاها ف الاوردر </span></p><p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;color:#953735;mso-themecolor:accent2;mso-themeshade:191;mso-style-textfill-fill-color:\r\n#953735;mso-style-textfill-fill-themecolor:accent2;mso-style-textfill-fill-alpha:\r\n100.0%;mso-style-textfill-fill-colortransforms:lumm=75000;mso-bidi-language:\r\nAR-EG\">وبعد كدا هتدوس علي كلمه طلب كدا الاوردر هيكون وصل لينا </span></p><br><p><br></p>', '2021-03-17 17:13:02', '2021-03-17 17:13:34'),
(8, 'شحن المنتجات ومده التوصيل ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">استلام الاوردر من 3 ل 5 ايام في القاهره\r\nوالجبزه </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">واسبوع في المحافظات<b></b>\r\n    </span>\r\n</p><br>', '2021-03-17 17:14:13', '2021-03-17 17:14:13'),
(9, 'هل ابتكار دوت نت عندها مقر فعلي ولا اونلاين بس ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <b><span dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Arial;mso-bidi-theme-font:minor-bidi;color:red;mso-bidi-language:\r\nAR-EG\"><span style=\"mso-spacerun:yes\">&nbsp;</span></span></b><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;mso-ascii-font-family:Calibri;mso-ascii-theme-font:\r\nminor-latin;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Arial;mso-bidi-theme-font:minor-bidi;mso-bidi-language:\r\nAR-EG\">عندنا مقر في وسط البلد في عابدين <b></b>\r\n    </span>\r\n</p><br>', '2021-03-17 17:14:42', '2021-03-17 17:14:42'),
(10, 'اعمل ايه لما اواجهه مشكله ف السيستم ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">هتتواصل مع مسئول الجوده وهو هيساعدك في حلها\r\n</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-EG\">هتلاقي رقم شغال الاتنين فون وواتس اب </span></p><br>', '2021-03-17 17:15:19', '2021-03-17 17:15:19'),
(11, 'هتعمل ايه لوعميل عنده مشكله في منتج ؟', '<p><span>هتتواصل مع مسئول الجوده وهو هيساعدك في حلها\r\n</span></p>', '2021-03-17 17:15:49', '2021-03-17 17:15:49'),
(12, 'امتي اقدر اسحب الرصيد بتاعي ؟', '<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-family: Calibri, sans-serif; font-size: 11pt;\">\r\n\r\n\r\n    <span lang=\"AR-EG\" dir=\"RTL\" style=\"\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\"><strong>يوم الجمعه من كل اسبوع هو الي ينفع تعمل فيه\r\nطلب سحب للرصيد الفعلي</strong></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; line-height: 115%; font-family: Calibri, sans-serif; font-size: 11pt;\"><strong><span lang=\"AR-EG\" dir=\"RTL\" style=\"font-family:\" arial\",sans-serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:=\"\" calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:arial;mso-bidi-theme-font:=\"\" minor-bidi;mso-bidi-language:ar-eg\"=\"\"><span style=\"mso-spacerun:yes\">&nbsp;</span>بتاعك وهنحوله ليك علي فودافون كاش او حساب بنكي\r\n    </span>\r\n</strong></p><br>', '2021-03-17 17:17:13', '2021-04-22 09:03:31'),
(13, 'Aliquip asperiores e', '<p>Vel aut ex consequat.</p>', '2023-03-07 14:36:16', '2023-03-07 14:36:16');
