(5, 'terms', '<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\">\r\n\r\n\r\n    <b><span lang=\"AR-SA\" style=\"font-size:18.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">صفحة\r\nسياسة الخصوصية</span></b></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">في موقع\r\n(<a href=\"https://ebtekarstore.net/\">https://ebtekarstore.net/</a>)، ندرك أن خصوصية معلوماتك الشخصية هامة لك ولنا</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">.</span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">فيما يلي\r\nمعلومات حول أنواع المعلومات الشخصية التي نتلقاها ونقوم بجمعها عند زيارات (ابتكار ستور)، وكيف نقوم بحماية معلوماتك الشخصية</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><b><span lang=\"AR-SA\" style=\"font-size:16.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">ملفات\r\nالسجل</span></b></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">كما هو\r\nالحال مع معظم مواقع الويب المختلفة، نقوم بجمع واستخدام البيانات الموجودة في\r\nملفات السجل</span><span dir=\"LTR\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">تشمل\r\nالمعلومات الموجودة في ملفات السجل عنوان بروتوكول الإنترنت</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"> (IP) </span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">الخاص بك، ومزود خدمة الإنترنت</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"> (ISP)</span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">، والمتصفح الذي استخدمته لزيارة موقعنا، والوقت الذي قمت فيه بالزيارة، والصفحات التي قمت بزيارتها عبر موقعنا</span><span dir=\"LTR\" style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><b><span lang=\"AR-SA\" style=\"font-size:16.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">ملفات\r\nتعريف الارتباط</span></b></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">نحن نستخدم\r\nملفات تعريف الارتباط لنمنحك أفضل تجربة أستخدام ممكنة على موقع بسيط، لمزيد من\r\nالمعلومات حول ملفات تعريف الارتباط ، تفضل بزيارة (&nbsp;<a href=\"https://ebtekarstore.net/\">https://ebtekarstore.net/</a>&nbsp;)</span></p><p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><strong><span lang=\"AR-SA\" style=\"font-size:16.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">ملفات\r\nتعريف الارتباط الأساسية</span></strong></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">تعد ملفات\r\nتعريف الارتباط الأساسية ضرورية لك للتنقل والتنقل في جميع أنحاء الموقع، ولا تخزن\r\nأي معلومات يمكن استخدامها لأغراض الدعاية، بدون ملفات تعريف الارتباط الأساسية،\r\nلن يعمل موقعنا بشكل صحيح</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><b><span lang=\"AR-SA\" style=\"font-size:16.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">ملفات\r\nتعريف الارتباط المخصصة</span></b></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">تخزن ملفات\r\nتعريف الارتباط هذه المعلومات ، مثل تفضيلاتك الشخصية ، وتستخدمها لتخصيص تجربة\r\nفريدة لك</span><span dir=\"LTR\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">قد يشمل\r\nذلك عرض نافذة منبثقة مرة واحدة فقط في زيارتك ، أو حفظ تفضيلات اللغة الخاصة بك ،\r\nأو السماح لك بتسجيل الدخول تلقائيًا إلى بعض ميزاتنا</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><b><span lang=\"AR-SA\" style=\"font-size:16.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">ملفات\r\nتعريف الارتباط في</span></b><b><span dir=\"LTR\" style=\"font-size:16.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"> Analytics</span></b></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">تلتقط\r\nملفات تعريف الارتباط من</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"> Analytics </span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">بيانات مجهولة المصدر حتى نتمكن من رؤية الاتجاهات وتحسين\r\nتجربة موقعنا على الويب</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">هذه تتيح\r\nلنا اختبار تصميمات مختلفة ، وتساعدنا على تحديد الكسر إذا كان جزء من موقعنا لا\r\nيعمل</span><span dir=\"LTR\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><strong><span lang=\"AR-SA\" style=\"font-size:16.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">ملفات\r\nتعريف الارتباط للإعلانات</span></strong></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">قد يستخدم\r\nبعض المعلنين من الجهات الخارجية ملفات تعريف الارتباط أو إشارات الويب عند\r\nالإعلان على موقعنا</span><span dir=\"LTR\" style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">.</span>\r\n</p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unicode-bidi: embed; font-size: 11pt; font-family: Calibri, &quot;sans-serif&quot;;\"><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\">سيقوم\r\nهؤلاء بإرسال معلومات إلى هؤلاء المعلنين</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"> (</span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">مثل</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"> Google </span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">من خلال برنامج</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"> Google AdSense) </span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">بما في ذلك عنوان</span><span dir=\"LTR\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"> IP </span><span lang=\"AR-SA\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">الخاص بك ، ومزود خدمة الإنترنت ،\r\nوالمتصفح الذي استخدمته لزيارة موقعنا ، وفي بعض الحالات معلومات حول ما إذا كنت\r\nقد قمت بتثبيت</span><span dir=\"LTR\" style=\"font-size:12.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;\"> Flash.</span>\r\n</p>\r\n\r\n<ul type=\"disc\" style=\"margin-bottom: 0cm;\">\r\n    <li class=\"MsoNormal\" dir=\"RTL\" style=\"margin: 0cm 0cm 8pt; text-align: right; line-height: 107%; direction: rtl; unico