(1043, 'receipt-company#1043', 'د محمد عوض', '01227887596', NULL, '0000-00-00', 'محطه ثكنات المعادي', 0, 30, 0, '<p>استاند اسم مكتب بعت صورته ع الواتس اب&nbsp;</p><p>مكتوب عليه&nbsp;</p><p>د. محمد عوض سليمان&nbsp;</p><p>ويكتب تحته\r\n\r\nاستشاري الباطنة والغدد الصماء والسكر<br></p><p><br></p>', 65, NULL, 'delivered', 'unpaid', 54, 'محطه ثكنات المعادي', 82, NULL, NULL, 1, '0000-00-00', 1, 'individual', 0, 1, 0, '0000-00-00 00:00:00', NULL, NULL, 'pending', 0, NULL, NULL, NULL, NULL, NULL, '2021-06-17 10:19:34', '2021-08-21 01:49:57', NULL),
(1044, 'receipt-company#1044', 'عمر محمد', '01069100974', NULL, '0000-00-00', '٤١٧ ن شارع الجيش هضبة الاهرام- بوابة مينا\r\nالدور الأرضي \r\nشقه ٢', 200, 40, 50, '<p>بوكس ايه ونوت بوك هافان</p><p>البوكس من بره اسم</p><p>مريم </p><p>والنوت بوك عليها اسم مريم وجمله&nbsp;</p><p>أعود منتصرًا بكل معاركى..و أمام عينيكى البريئة أُهزَمُ</p><p>والقلم اسم&nbsp;&nbsp;</p><p>Mon amour<br></p>', 65, NULL, 'delivered', 'unpaid', 17, 'القاهره', 82, NULL, NULL, 1, '0000-00-00', 1, 'individual', 0, 1, 0, '0000-00-00 00:00:00', NULL, NULL, 'pending', 0, NULL, NULL, NULL, NULL, NULL, '2021-06-17 12:10:35', '2021-08-21 01:49:57', NULL),
(1045, 'receipt-company#1045', 'مؤمن  ابو زيد', '01069100974', NULL, '0000-00-00', 'مدينة اكتوبر الحي الرابع مجاورة سادسة محور الكفراوي عمارة 1371 دور 1 شقة 1', 800, 40, 0, '<p>اعدد اتنين بوكس مكتوب  عليه</p><p>Well done وعلامه&nbsp; كاب التخرج&nbsp;</p><p> واحد اسم ريم و واحد اسم </p><p>Engy&nbsp;</p><p>و&nbsp;عدد 3 أقلام مضيئة بالعلبة و بأسماء</p><p> Nour</p><p> Ahmed</p><p>شريف</p><p>عاوز علبة قلم  من برا نكتب Markopediaمن جوا على القلم اسم Aya</p><p>&nbsp;علبة قلم كمان باسم Mahmoud<br></p>', 65, NULL, 'delivered', 'unpaid', 17, 'القاهره', 82, NULL, NULL, 1, '0000-00-00', 1, 'individual', 1, 1, 0, '0000-00-00 00:00:00', NULL, NULL, 'pending', 0, NULL, NULL, NULL, NULL, NULL, '2021-06-17 12:56:40', '2021-08-21 01:49:57', NULL),
